#include "by_ICAO.h"

#include <stdio.h>
#include <string.h>
#include <time.h>
#include <errno.h>

#include <openssl/lhash.h>
#include <openssl/buffer.h>
#include <openssl/pem.h>
#include <openssl/err.h>

static int get_cert_by_subject(X509_LOOKUP *xl, int type, X509_NAME *name,
		X509_OBJECT *ret);

X509_LOOKUP_METHOD x509_ICAO_lookup =
    {
    "Load ICAO certificates into cache",
    NULL,        /* new */
    NULL,        /* free */
    NULL,         /* init */
    NULL,        /* shutdown */
    NULL,        /* ctrl */
    get_cert_by_subject, /* get_by_subject */
    NULL,        /* get_by_issuer_serial */
    NULL,        /* get_by_fingerprint */
    NULL,        /* get_by_alias */
};

X509_LOOKUP_METHOD *X509_LOOKUP_ICAO(void)
    {
         return(&x509_ICAO_lookup);
    }

#define Ncerts sizeof certs / sizeof certs[0]

static int get_cert_by_subject(X509_LOOKUP *xl, int type, X509_NAME *name,
		               X509_OBJECT *ret)
{
    union {
        struct {
            X509 st_x509;
            X509_CINF st_x509_cinf;
        } x509;
        struct {
            X509_CRL st_crl;
            X509_CRL_INFO st_crl_info;
        } crl;
    } data;
    int ok = 0;
    int i, j;
    unsigned long h;
    char hashName[10];
    X509_OBJECT stmp, *tmp;
    BIO *in=NULL;
    X509 *x=NULL;

    if (name == NULL)
        return (0);

    stmp.type = type;
    if (type == X509_LU_X509) {
        data.x509.st_x509.cert_info = &data.x509.st_x509_cinf;
        data.x509.st_x509_cinf.subject = name;
        stmp.data.x509 = &data.x509.st_x509;
    }

    h = X509_NAME_hash(name);
    snprintf(hashName, 10, "%08lx", h);

    for (i = 0; i < Ncerts; i++) {
        if (strncmp(certs[i].hash, hashName, 8) == 0) {

            in=BIO_new(BIO_s_mem());
	    BIO_write(in, certs[i].cert, strlen(certs[i].cert)+1);
	    x=PEM_read_bio_X509_AUX(in,NULL,NULL,NULL);
 
	    j=X509_STORE_add_cert(xl->store_ctx, x);
	    if (!j)
	        break;

	    if (x != NULL) {
		x = NULL;
                X509_free(x);
	    }
            if (in != NULL) {
                BIO_free(in);
		in = NULL;
	    }
	}
    }

    // Pull from cache
    CRYPTO_w_lock(CRYPTO_LOCK_X509_STORE);
    j = sk_X509_OBJECT_find(xl->store_ctx->objs, &stmp);
    if (j != -1)
        tmp = sk_X509_OBJECT_value(xl->store_ctx->objs, j);
    else
        tmp = NULL;
    CRYPTO_w_unlock(CRYPTO_LOCK_X509_STORE);

    // return first certificate from cache:
    // but if it wasn't the required one, then X509_STORE_CTX_get1_issuer() will 
    // keep on searching until finding  the certificate accepted by check_issued
    if (tmp != NULL) {
        ok = 1;
        ret->type = tmp->type;
        memcpy(&ret->data, &tmp->data, sizeof(ret->data));
    }

    if (x != NULL) 
	    X509_free(x);
    if (in != NULL)
	    BIO_free(in);

    return (ok);
}
